/*Table structure for table `auth_data_field` */

DROP TABLE IF EXISTS `auth_data_field`;

CREATE TABLE `auth_data_field` (
  `id` varchar(16) NOT NULL DEFAULT '',
  `code` varchar(100) NOT NULL DEFAULT '' COMMENT '唯一标识',
  `menu_id` varchar(32) NOT NULL DEFAULT '' COMMENT '菜单ID',
  `description` varchar(255) NOT NULL DEFAULT '' COMMENT '描述',
  `create_time` datetime NOT NULL COMMENT '创建时间',
  `creator` varchar(32) NOT NULL DEFAULT '' COMMENT '创建人',
  `name` varchar(50) NOT NULL DEFAULT '' COMMENT '字段名称',
  `is_enable` int(1) NOT NULL DEFAULT '0' COMMENT '是否删除0否1删除',
  PRIMARY KEY (`id`)
) ENGINE=InnoDB DEFAULT CHARSET=utf8 COMMENT='字段';

/*Data for the table `auth_data_field` */

/*Table structure for table `auth_dict` */

DROP TABLE IF EXISTS `auth_dict`;

CREATE TABLE `auth_dict` (
  `id` varchar(16) NOT NULL COMMENT '标示',
  `dict_type` varchar(64) NOT NULL DEFAULT '' COMMENT '字典类别',
  `dict_type_name` varchar(64) NOT NULL COMMENT '字典类别名称',
  `dict_name` varchar(64) NOT NULL DEFAULT '' COMMENT '字典名称',
  `dict_code` varchar(64) NOT NULL DEFAULT '' COMMENT '字典代码',
  `status` int(2) NOT NULL DEFAULT '0' COMMENT '状态（0：禁用；1：可用）',
  `remark` varchar(300) NOT NULL DEFAULT '' COMMENT '备注',
  `order_id` varchar(8) NOT NULL COMMENT '排序',
  `create_time` datetime NOT NULL COMMENT '创建时间',
  `creator` varchar(16) NOT NULL DEFAULT '' COMMENT '创建人',
  PRIMARY KEY (`id`)
) ENGINE=InnoDB DEFAULT CHARSET=utf8 COMMENT='数据字典';

